import React from "react";
import { Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/navBar";
import { StudentHomePage, CourseListPage, AdvisorContactInfo } from "./pages";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/" component={StudentHomePage} />
        <Route exact path="/CourseList" component={CourseListPage} />
        <Route
          exact
          path="/AdvisorInformation"
          component={AdvisorContactInfo}
        />
      </Switch>
    </div>
  );
}

export default App;
